import React from "react";
import { CircularProgress, Grid, Typography } from "@material-ui/core";
// hook
import { useFetch } from "../../../hooks";
// components
import CultrueCards from "./CultureCards";
import Collapse from "@material-ui/core/Collapse";
import ListSubheader from "@material-ui/core/ListSubheader";
import List from "@material-ui/core/List";
import ListItem from "@material-ui/core/ListItem";
import ListItemText from "@material-ui/core/ListItemText";
import {
  ListItemIcon,
  ExpandLess,
  ExpandMore,
  InboxIcon,
} from "@material-ui/icons/StarBorder";

import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles((theme) => ({
  root: {
    width: "100%",
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  },
  nested: {
    paddingLeft: theme.spacing(4),
  },
}));

const ClientCulture = () => {
  const { data, isLoading } = useFetch("/cultures/group");
  const [open, setOpen] = React.useState(true);
  const classes = useStyles();
  const handleClick = () => {
    setOpen(!open);
  };

  const cultureCards = data.map((information) => (
    <Grid key={information._id} item xs={12}>
      <Typography variant="h6">{information._id}</Typography>
      <List
        component="nav"
        aria-labelledby="nested-list-subheader"
        subheader={
          <ListSubheader component="div" id="nested-list-subheader">
            Nested List Items
          </ListSubheader>
        }
        className={classes.root}
      >
        <ListItem button onClick={handleClick}>
          <ListItemText primary="Inbox" />
          {open ? <ExpandLess /> : <ExpandMore />}
        </ListItem>

        <Collapse in={open} timeout="auto" unmountOnExit>
          <List component="div" disablePadding>
            <CultrueCards
              countrySource={information._id}
              information={information.data}
            />
          </List>
        </Collapse>
      </List>
    </Grid>
  ));

  return (
    <div>
      <Grid item xs={12}>
        <Grid container spacing={3}>
          {isLoading ? (
            <Grid item xs={12}>
              <CircularProgress />
            </Grid>
          ) : (
            cultureCards
          )}
        </Grid>
      </Grid>
    </div>
  );
};

export default ClientCulture;
